    key: "calculator",
    value: function calculator(initDeposit, amtDesired, intRate, year) {
      /*var initialDeposit      	= 0;
      var amountDesired       	= 200000;
      var rate                 	= 8 / 1200.0;
      var nrOfDeposits         	= Math.round(5 * 12);*/
      var initialDeposit = initDeposit;
      var amountDesired = amtDesired;
      var rate = intRate / 1200.0;
      var nrOfDeposits = Math.round(year * 12);
      var unroundedDeposit;
      var factr = 1;
      var ratePlusOne = rate + 1;

      for (var i = 0; i < nrOfDeposits; i++) {
        factr *= ratePlusOne;
      }

      if (factr > 1) {
        var factr2 = rate / (factr - 1);
        unroundedDeposit = Math.round((amountDesired - initialDeposit * factr) * factr2);
        return unroundedDeposit; //alert('unroundedDeposit' + unroundedDeposit);
      }
    }
